column8:
壁紙を貼りかえるための、施工道具です。<br>
初心者の方にオススメ！基本道具3点セットです。
<br> 
<br> 
仕様<br>
★ 壁紙の空気抜きに。<br>
一行ブラシ（穴なしタイプ）<br><br>
★ コーナーや重ね切りのカッターガイド <br>
地ベラ＜８寸タイプ＞ <br><br>
★ 壁紙のつなぎ目の押さえに <br>
